import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";
import logo from "./logo.png";
import { FaCartPlus, FaSearch, FaUser, FaRegUser } from "react-icons/fa"; // Import icons from React Icons

const Header = () => {
  return (
    <header className="header">
      <div className="logo">
        <img src={logo} alt="EventEase Logo" className="logo-img" />
        <h1 className="event-name">EventEase</h1>
      </div>
      <nav className="nav-links">
        <Link to="/cart" className="nav-item">
          Cart <FaCartPlus className="icon" /> {/* Cart Icon */}
        </Link>
        <Link to="/search" className="nav-item">
          Search <FaSearch className="icon" /> {/* Search Icon */}
        </Link>
        <Link to="/login" className="nav-item">
          Login <FaUser className="icon" /> {/* Login Icon */}
        </Link>
        <Link to="/signup" className="nav-item">
          Signup <FaRegUser className="icon" /> {/* Signup Icon */}
        </Link>
      </nav>
    </header>
  );
};

export default Header;
